The nonlinear dynamic stability of the stiffened PSC under biaxial velocity impacts and movable boundary conditions is systematically investigated herein. Manifold effects of the damping ratio, impact speed, initial imperfection, elastic foundation parameters, thermal escalation, axial compression ratio, and oblique stiffeners on structure dynamic buckling behaviour are examined individually. The nonlinear dynamic biaxial buckling Eq. (35) is solved by applying the fourth-order Runge–Kutta method with initial conditions assumed as W(0)=W0,∂W∂t(0)=0\documentclass[12pt]{minimal}
