				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$W(0) = W_{0} , \, \frac{\partial W}{{\partial t}}(0) = 0$$\end{document}. The critical buckling load is captured based on the Budiansky–Roth criterion [68].

